import { BrowserRouter, Route, Switch } from "react-router-dom";
import Home from "./view/Home";
import RegisterPerson from "./view/RegisterPerson";
import RegisterProduct from "./view/RegisterProduct";

const Routes = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
        <Route path="/RegisterPerson">
          <RegisterPerson />
        </Route>
        <Route path="/RegisterProduct">
          <RegisterPerson />
        </Route>
      </Switch>
    </BrowserRouter>
  );
};

export default Routes;
